  return (
    <Container fluid>
      <Row no-gutters>
        <Col className="bg-white" md={{ span: 2, offset: 1 }}>
          <img src={prueba} alt="logo" style={img}></img>
        </Col>
        <Col className="bg-white" md={6}>
          <p style={price}> 1890 <img src={ic_shipping} alt="logo"></img>
          </p>
          <p style={{ fontSize: '18px' }}> Banco Redondo Taburete Banqueta De Pino Natural 60cm </p>
        </Col>
        <Col className="bg-white" md={2}>
          <p style={{ fontSize: '12px', color: '#999999', marginTop: '32px' }}>Ubicaci√≥n</p>
        </Col>
      </Row>
    </Container>
  );
};
